import React, { Component } from 'react';
import Button from '@material-ui/core/Button';
import Header from './Header';
import history from './history';

class Plainte extends Component {

    render() {
      return (
          <div>
<form>
      <div class="form-group">
           <div class="form-row">
          <label class="col-md-3" for="nom">Nom</label> 
          <div class="col-md-9">
              <input id="nom" type="text" class="form-control" name="" placeholder="Entrer votre nom"></input>
          </div>
        </div>
      </div>
      <div class="form-group">
        <div class="row">
          <label class="col-md-3" for="mail">Email</label> 
          <div class="col-md-9">
               <input id="mail" type="text" class="form-control" name="" placeholder="Entrer votre mail"></input>
          </div>
        </div>
      </div>

      <div class="form-group">
        <div class="row">
          <div class="col-md-1 offset-md-11">
                 <button class="btn btn-warning">Envoyer</button>
            </div>
        </div>
      </div>
    </form>
           </div>



      );
    }

  }


export default Plainte;
